    width: 350px;
    height: 260px;
    padding: 20px;
    box-shadow: 0 2px 4px 0 rgba(0, 0, 0, 0.5);
    background-color: 	rgb(255,215,0);
}

.weatherContainer h2 {
    font-family: Montserrat;
    font-size: 18px;
    line-height: 1.00;
    text-align: left;
    color: #4a4a4a;
    position: relative;
    padding: 5px;
}

.weatherContainer {
    margin: 20px auto;
    display: flex;
    flex-direction: column;
    align-items: center;

}

.weatherContainer {
    padding: 10px 20px;
    height: 100%;
}
.weatherContainer  h3 {
    font-family: Montserrat;
    font-size: 22px;
    font-weight: 300;
    letter-spacing: 3.4px;
    text-align: left;
    color: #4a4a4a;
}
`;


